import React from 'react';
import { Row, Col } from 'antd';

const imageUrls = [
  'image-url-1.jpg',
  'image-url-2.jpg',
  'image-url-3.jpg',
  'image-url-4.jpg',
  'image-url-5.jpg',
  'image-url-6.jpg',
  'image-url-7.jpg',
  'image-url-8.jpg',
  'image-url-9.jpg',
];

const ImageGrid = () => {
  return (
    <Row gutter={[16, 16]}>
      {imageUrls.map((imageUrl, index) => (
        <Col key={index} xs={24} sm={12} md={8} lg={8} xl={8}>
          <img
            src={imageUrl}
            alt={`Image ${index + 1}`}
            style={{ width: '100%', height: '100%', objectFit: 'cover' }}
          />
        </Col>
      ))}
    </Row>
  );
};

export default ImageGrid;
